firestore rule을 설정하고 있는데,
```match /AssetReviews/{assetReviewId} {
 allow read;
 allow create: if request.auth.uid != null;
 allow update, delete: if resource.data.uid == request.auth.uid;
 }```
위와 같은 rule로 아래와 같은 테스트 코드를 짰어
```import { readFileSync } from "fs";
import { resolve } from "path";
import { deleteDoc, doc, getDoc, setDoc, updateDoc } from "firebase/firestore";
import {
 RulesTestEnvironment,
 assertFails,
 assertSucceeds,
 initializeTestEnvironment,
} from "@firebase/rules-unit-testing";

const COLLECTION\_NAME = "AssetReviews";

const DOCUMENT\_ID = "test-asset-review-id";

const TEST\_USER\_ID = "test-user-id";

const genAuthorizedDocRef = (firestore: any) => doc(firestore, COLLECTION\_NAME, DOCUMENT\_ID);

describe("AssetReviews 규칙 테스트", () => {
 let testEnv: RulesTestEnvironment;

 beforeAll(async () => {
 testEnv = await initializeTestEnvironment({
 projectId: "asset-reviews-rule-test",
 firestore: {
 rules: readFileSync(resolve(\_\_dirname, "firestore.rules"), "utf-8"),
 },
 });
 });

 beforeEach(async () => {
 await testEnv.withSecurityRulesDisabled(async (ctx) => {
 await setDoc(genAuthorizedDocRef(ctx.firestore()), {
 foo: "bar",
 uid: TEST\_USER\_ID,
 });
 });
 });

 afterAll(async () => {
 await testEnv.cleanup();
 });

 afterEach(async () => {
 await testEnv.clearFirestore();
 });

 describe("인증이 없는 상태", () => {
 test("Create을 할 수 없다", async () => {
 const noAuth = testEnv.unauthenticatedContext();
 const docRef = doc(noAuth.firestore(), COLLECTION\_NAME, DOCUMENT\_ID);

 await assertFails(
 setDoc(docRef, {
 foo: "baz",
 })
 );
 });

 test("Read를 할 수 있다", async () => {
 const noAuth = testEnv.unauthenticatedContext();
 const docRef = doc(noAuth.firestore(), COLLECTION\_NAME, DOCUMENT\_ID);

 await assertSucceeds(getDoc(docRef));
 });

 test("Update를 할 수 없다", async () => {
 const noAuth = testEnv.unauthenticatedContext();
 const docRef = doc(noAuth.firestore(), COLLECTION\_NAME, DOCUMENT\_ID);

 await assertFails(
 updateDoc(docRef, {
 foo: "baz",
 })
 );
 });

 test("Delete를 할 수 없다", async () => {
 const noAuth = testEnv.unauthenticatedContext();
 const docRef = doc(noAuth.firestore(), COLLECTION\_NAME, DOCUMENT\_ID);

 await assertFails(deleteDoc(docRef));
 });
 });

 describe("인증이 있지만 글 작성자가 아닌 상태", () => {
 test("새로운 글을 Create을 할 수 있다", async () => {
 const auth = testEnv.authenticatedContext("another-test-user-id");
 const docRef = doc(auth.firestore(), COLLECTION\_NAME, "new-document-id");

 await assertSucceeds(
 setDoc(docRef, {
 foo: "baz",
 uid: "another-test-user-id",
 })
 );
 });

 test("Read를 할 수 있다", async () => {
 const auth = testEnv.authenticatedContext("another-test-user-id");
 const docRef = genAuthorizedDocRef(auth.firestore());

 await assertSucceeds(getDoc(docRef));
 });

 test("Update를 할 수 없다", async () => {
 const auth = testEnv.authenticatedContext("another-test-user-id");
 const docRef = genAuthorizedDocRef(auth.firestore());

 await assertFails(
 updateDoc(docRef, {
 foo: "baz",
 uid: "another-test-user-id",
 })
 );
 });

 test("Delete를 할 수 없다", async () => {
 const auth = testEnv.authenticatedContext("another-test-user-id");
 const docRef = genAuthorizedDocRef(auth.firestore());

 await assertFails(deleteDoc(docRef));
 });
 });

 describe("내가 글 작성자인 상태", () => {
 test("Create을 할 수 있다", async () => {
 const auth = testEnv.authenticatedContext(TEST\_USER\_ID);

 const docRef = doc(auth.firestore(), COLLECTION\_NAME, "new-document-id");

 await assertSucceeds(
 setDoc(docRef, {
 foo: "baz",
 uid: TEST\_USER\_ID,
 })
 );
 });

 test("Read를 할 수 있다", async () => {
 const auth = testEnv.authenticatedContext(TEST\_USER\_ID);

 const docRef = genAuthorizedDocRef(auth.firestore());

 await assertSucceeds(getDoc(docRef));
 });

 test("Update를 할 수 있다", async () => {
 const auth = testEnv.authenticatedContext(TEST\_USER\_ID);

 const docRef = genAuthorizedDocRef(auth.firestore());

 await assertSucceeds(
 updateDoc(docRef, {
 foo: "baz",
 })
 );
 });

 test("Delete를 할 수 있다", async () => {
 const auth = testEnv.authenticatedContext(TEST\_USER\_ID);

 const docRef = genAuthorizedDocRef(auth.firestore());

 await assertSucceeds(deleteDoc(docRef));
 });
 });

 describe("Admin인 상태", () => {
 test("Update를 할 수 있다", async () => {
 const auth = testEnv.authenticatedContext("admin-id", { admin: true });

 const docRef = genAuthorizedDocRef(auth.firestore());

 await assertSucceeds(
 updateDoc(docRef, {
 foo: "baz",
 confirmed: true,
 })
 );
 });

 test("Delete를 할 수 있다", async () => {
 const auth = testEnv.authenticatedContext("admin-id", { admin: true });

 const docRef = genAuthorizedDocRef(auth.firestore());

 await assertSucceeds(deleteDoc(docRef));
 });
 });
});```
