```
match /GroupChats/{groupChatId} {
 function isGroupChatOwner() {
 let groupChatSession = get(`/GroupChats/$(groupChatId)/GroupChatSessions/$(groupChatId)\_$(request.auth.uid)`);

 let role = groupChatSession.data.role;

 return role == "owner";
 }
 allow read;
 allow write: if request.auth.uid != null;
 allow update, delete: if isGroupChatOwner();
 }
```
